import React, { useEffect, useMemo, useState } from "react";
import { MapContainer, TileLayer, Marker, Popup } from "react-leaflet";
import "leaflet/dist/leaflet.css";
import Papa from "papaparse";

const CENTER = { lat: 14.1467, lng: 121.4708 };

export default function Home() {
  const [spots, setSpots] = useState([]);
  const [userPreferences, setUserPreferences] = useState({});
  const [weather, setWeather] = useState({});
  const [mapLoaded, setMapLoaded] = useState(false);

  // Load spots data from CSV
  useEffect(() => {
    fetch("/data/spots.csv")
      .then((res) => res.text())
      .then((csv) => {
        Papa.parse(csv, {
          header: true,
          skipEmptyLines: true,
          complete: (results) => {
            // Log parsed data to debug
            console.log("Parsed CSV Data:", results.data);

            const rows = results.data
              .filter((r) => r.name && r.lat && r.lng) // Ensure lat/lng are present
              .map((r) => ({
                name: r.name.trim(),
                lat: parseFloat(r.lat),
                lng: parseFloat(r.lng),
                visitors: r.visitors.trim() || "Moderate",
                image: r.image || null,
                type: r.tags || "nature", // If tags are present, use them
                description: r.description || "",
              }));

            console.log("Filtered Spots:", rows);  // Log filtered spots to see their values
            setSpots(rows);
          },
        });
      });
  }, []);

  // Load weather data (dummy example)
  useEffect(() => {
    fetchWeatherData();
  }, []);

  const fetchWeatherData = async () => {
    const response = await fetch("https://api.openweathermap.org/data/2.5/weather?q=Majayjay&appid=YOUR_API_KEY");
    const data = await response.json();
    setWeather(data);
  };

  // Sort spots by user preferences
  const topSpots = useMemo(() => {
    const order = { "Very High": 3, High: 2, Moderate: 1, Low: 0 };

    // Filter spots based on user preferences (type, visitor level, etc.)
    const filteredSpots = spots.filter((s) => {
      return (
        (userPreferences.likesNature && s.type.includes("nature")) ||
        (userPreferences.likesHistory && s.type.includes("history"))
      );
    });

    return [...filteredSpots]
      .sort((a, b) => (order[b.visitors] || 0) - (order[a.visitors] || 0))
      .slice(0, 5);  // Top 5 spots
  }, [spots, userPreferences]);

  // Route Planner function (filters spots based on preferences)
  const generateRoute = () => {
    if (!spots.length) return alert("Select at least one spot!");

    const route = spots.filter((s) => {
      return (
        (userPreferences.likesNature && s.type.includes("nature")) ||
        (userPreferences.likesHistory && s.type.includes("historical"))
      );
    });

    alert(`Suggested Route: ${route.map((s) => s.name).join(", ")}`);
  };

  // Check if map data is available before rendering the map
  const handleMapLoad = () => {
    setMapLoaded(true);
  };

  return (
    <div style={{ display: "grid", gap: 16, gridTemplateColumns: "1fr 1fr" }}>
      <div className="card">
        <h2>Majayjay Overview</h2>
        <div className="map-wrap" style={{ height: "500px" }}>
          {mapLoaded && (
            <MapContainer
              center={CENTER}
              zoom={13}
              style={{ height: "100%", width: "100%" }}
              whenCreated={handleMapLoad} // Fires after the map is created
            >
              <TileLayer
                attribution='&copy; <a href="https://www.openstreetmap.org/">OSM contributors</a>'
                url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
              />
              {topSpots.map((s, i) => (
                <Marker key={i} position={[s.lat, s.lng]}>
                  <Popup>
                    <strong>{s.name}</strong>
                    <br />
                    Visitors: {s.visitors}
                    {s.image && (
                      <>
                        <br />
                        <img
                          src={s.image}
                          alt={s.name}
                          style={{ width: "150px", borderRadius: "8px", marginTop: "4px" }}
                        />
                      </>
                    )}
                    <p>{s.description}</p> {/* Description of the spot */}
                  </Popup>
                </Marker>
              ))}
            </MapContainer>
          )}
        </div>
      </div>

      <div className="card">
        <h2>Most Visited Places</h2>
        <ul style={{ margin: 0, paddingLeft: 18 }}>
          {topSpots.map((s, i) => (
            <li key={i}>
              <strong>{s.name}</strong> â€” {s.visitors} visitors
            </li>
          ))}
          {topSpots.length === 0 && <li>No spots found in CSV</li>}
        </ul>
        <button onClick={generateRoute}>Generate Route</button>
      </div>
    </div>
  );
}
